    public static double[] get(String Path) {
        String[] data = Path.split("/");
        String type = data[0];
        String name = data[1].split("\\.")[0];
        switch (type) {
            case "block":
                if (BLOCK.containsKey(name)) {
//                    LOGGER.info("Returning: " + Arrays.toString(BLOCK.get(name)) + ", from: BLOCK, name: " + name);
                    return BLOCK.get(name);
                }
                else {
                    LOGGER.warn("Unsupported block: {}", name);
                }
                break;
            case "blocks":
                if (BLOCKS.containsKey(name)) {
//                    LOGGER.info("Returning: " + Arrays.toString(BLOCKS.get(name)) + ", from: BLOCKS, name: " + name);
                    return BLOCKS.get(name);
                }
                else {
                    LOGGER.warn("Unsupported block: {}", name);
                }
                break;
            default:
                LOGGER.warn("Unsupported texture type: {}", type);
        }
//        LOGGER.info("Returning: " + Arrays.toString(new double[]{0, 0, 0, 0}) + ", from: DEFAULT, name: " + name);
        return new double[]{0, 0, 0, 0};
    }
